import React, { Component } from 'react';
import Continuar_bot  from '../components/Contiunar_bot.js'
import Icono_mpt from '../components/Icono_mpt' 

class Navigation extends Component{

  
  render(){
      
        return (
          <nav>
          <h1 class= "h4"> Bienvenido/a a Mpt! </h1>      
          <Icono_mpt> </Icono_mpt>
          <Continuar_bot>>
          </Continuar_bot>


        </nav>
      
        )
    }
}

export default Navigation;
